$(function() {
  $('.js-choose_school').on('change', function() {
    var def;
    def = $(this).val();
    return $.each($('.js-school_type_payments'), function(key, element) {
      return $(element).toggle($(element).data('school-type') === def);
    });
  });
  $('.js-toggle_applications').on('click', function(e) {
    var target;
    e.preventDefault();
    target = $(this).data('target');
    if (target && target.length > 0) {
      target = $('#' + target);
      if (target && target.length > 0) {
        return target.slideToggle(300);
      }
    }
  });
  $('.js-sum_change_field').numeric();
  return $('.js-sum_change_field').on('keyup', function() {
    return $('.js-sum_container').val($(this).val());
  });
});

